    INNER JOIN users u on u.id = p.user_id
    LEFT JOIN followers f ON f.from_id = \'\' and f.type = \'creator\' and f.to_id IN (p.user_id)
	
where
    p.user_id = u.id
	AND f.to_id IN(p.user_id)
    AND p.del_status = 1
    
    
	
	
